<script>
import myRequestsAPIs from '@/services/api/service-provider/user/my-requests.js'
import readyServiceAPIs from '@/services/api/service-provider/provider/ready-service'
import SectionUserInfo from './parts/section-user-info/index.vue'
import SectionContinueLearning from '@/views/service-provider/common-components/section-continue-learning/index.vue'
import SectionHear from '@/views/service-provider/common-components/section-hear/index.vue'

export default {
    name: 'request-page',
    components:{
        SectionHear,
        SectionUserInfo,
        SectionContinueLearning
    },
    data:()=>({
        loading:true,
        hasError:false,
        itemPage:{},
        isOwner:false,
    }),
    methods:{
    openEditDialog(){
      this.fireOpenDialog('update-item',this.itemPage)
    },
    openDeleteDialog(){
      this.fireOpenDialog('delete-item',this.itemPage)
    },
    async initializing() {
      this.loading = true;
      this.hasError = false;
            try {
                let { data } = await myRequestsAPIs.getItem(this.$route.params.id)
                if (data.success) {
                   this.itemPage = data.data;
                   this.isOwner = this.itemPage.user_id==this.user.id
                   try {
                  await readyServiceAPIs.setAsView(this.$route.params.id)
                } catch (error) {
                    console.log('error', error)
                    console.log('error response', error.response)
                }
                }else{
                  this.hasError = true;
                }
            } catch (error) {
                console.log('error', error)
                console.log('error response', error.response)
                //this.hasError = true;
              }

            this.loading = false;
        }
  },
  mounted(){
    this.initializing()
  }
}
</script>

